import React from "react";
import PropTypes from "prop-types";
import { MinusCircleOutlined } from "@ant-design/icons";
const TodoItem = ({ post }) => {
  const { textValue, checked } = post;

  return (
    <div>
      <div>{<MinusCircleOutlined />}</div>
      {textValue}
    </div>
  );
};

export default TodoItem;
